// src/components/BookReader.js
import React from 'react';
import { useParams } from 'react-router-dom';

const BookReader = () => {
    const { bookTitle } = useParams();

    return (
        <div className="book-reader">
            <h2>{bookTitle}</h2>
            {/* You can customize the iframe or add your own logic to fetch the book content */}
            <iframe
                src={`https://ccel.org/ccel/lawrence/practice/practice.i.html`}
                title={bookTitle}
                width="100%"
                height="600px"
                style={{ border: 'none' }}
            />
        </div>
    );
};

export default BookReader;
